import{_ as r,c as a,a2 as i,o as t}from"./chunks/framework.BDQf3LYc.js";const p=JSON.parse('{"title":"","description":"","frontmatter":{"outline":[2,3]},"headers":[],"relativePath":"02.Api 示例/01.PCILeechWiki/PCILeech-on-Windows.md","filePath":"02.Api 示例/01.PCILeechWiki/PCILeech-on-Windows.md"}'),o={name:"02.Api 示例/01.PCILeechWiki/PCILeech-on-Windows.md"};function n(l,e,d,s,h,c){return t(),a("div",null,e[0]||(e[0]=[i('<h2 id="pcileech-on-windows" tabindex="-1">PCILeech on Windows <a class="header-anchor" href="#pcileech-on-windows" aria-label="Permalink to &quot;PCILeech on Windows&quot;">​</a></h2><p>This section is about running PCILeech on Windows. For more information about targeting Windows systems please check <a href="https://github.com/ufrisk/pcileech/wiki/Target-Windows" target="_blank" rel="noreferrer">Target: Windows</a>. Please find a pre-compiled binary version of pcileech in the <a href="https://github.com/ufrisk/pcileech/releases/latest" target="_blank" rel="noreferrer">latest release</a> in the PCILeech repo.</p><hr><h3 id="required-library" tabindex="-1">Required Library: <a class="header-anchor" href="#required-library" aria-label="Permalink to &quot;Required Library:&quot;">​</a></h3><p>PCILeech is dependent on the <a href="https://github.com/ufrisk/LeechCore" target="_blank" rel="noreferrer">LeechCore</a> library for memory acquisition. The LeechCore library is distributed in the binary release. For more information about LeechCore acquisition library, the LeechAgent, and the full range of memory acquisition options please have a look at <a href="https://github.com/ufrisk/LeechCore" target="_blank" rel="noreferrer">LeechCore</a>.</p><p>PCILeech is dependent on the co-bundled <a href="https://github.com/ufrisk/LeechCore" target="_blank" rel="noreferrer">LeechCore</a> and <a href="https://github.com/ufrisk/MemProcFS" target="_blank" rel="noreferrer">MemProcFS</a> libraries.</p><h3 id="required-drivers-usb3380-hardware" tabindex="-1">Required Drivers (USB3380 Hardware): <a class="header-anchor" href="#required-drivers-usb3380-hardware" aria-label="Permalink to &quot;Required Drivers (USB3380 Hardware):&quot;">​</a></h3><p>The Google Android USB driver also have to be installed if USB3380 hardware is used. Download the Google Android USB driver from: <a href="http://developer.android.com/sdk/win-usb.html#download" target="_blank" rel="noreferrer">http://developer.android.com/sdk/win-usb.html#download</a> Unzip the driver. Open Device Manager. Right click on the computer, choose add legacy hardware. Select install the hardware manually. Click Have Disk. Navigate to the Android Driver, select android_winusb.inf and install.</p><h3 id="required-drivers-fpga-hardware" tabindex="-1">Required Drivers (FPGA Hardware): <a class="header-anchor" href="#required-drivers-fpga-hardware" aria-label="Permalink to &quot;Required Drivers (FPGA Hardware):&quot;">​</a></h3><p>FTDI drivers have to be installed if FPGA is used with FT601 USB3 addon card. FTDI drivers will installed automatically on Windows from Windows Update at first connection. PCILeech also requires 64-bit <a href="https://ftdichip.com/wp-content/uploads/2023/11/FTD3XXLibrary_v1.3.0.8.zip" target="_blank" rel="noreferrer"><code>FTD3XX.dll</code></a> which must be downloaded from FTDI and placed alongside <code>pcileech.exe</code>.</p><h3 id="required-drivers-file-system" tabindex="-1">Required Drivers - File System: <a class="header-anchor" href="#required-drivers-file-system" aria-label="Permalink to &quot;Required Drivers - File System:&quot;">​</a></h3><p>To use the mount functionality including:</p><ul><li>Mount target computer file system as folder.</li><li>Mount target computer live RAM as file.</li><li>The Memory Process File System.</li></ul><p>The Dokany file system library must be installed. Please download and install the latest stable version of Dokany version 2 at: <a href="https://github.com/dokan-dev/dokany/releases/latest" target="_blank" rel="noreferrer">https://github.com/dokan-dev/dokany/releases/latest</a></p><hr><h3 id="building-pcileech" tabindex="-1">Building PCILeech: <a class="header-anchor" href="#building-pcileech" aria-label="Permalink to &quot;Building PCILeech:&quot;">​</a></h3><p>PCILeech is dependent on <a href="https://github.com/ufrisk/LeechCore" target="_blank" rel="noreferrer">LeechCore</a> and <a href="https://github.com/ufrisk/MemProcFS" target="_blank" rel="noreferrer">MemProcFS</a>. Please ensure LeechCore and MemProcFS are placed alongside PCILeech.</p><p>Open the PCILeech project in Visual Studio 2019 or later. Enable the LeechCore and MemProcFS projects in the solution. Build. The resulting binaries will be placed in the <em>pcileech\\files</em> folder.</p><p>To build individual shellcode kernel modules and implants please individual instructions in each source file.</p>',19)]))}const f=r(o,[["render",n]]);export{p as __pageData,f as default};
